import { useState } from "react";
import "./tailwind.css";

function App() {
  const [inputValue, setInputValue] = useState();
  return (
    <>
      <div style={{ padding: 20 }}>
        <input
          type={"text"}
          onChange={(e) => setInputValue(e.target.value)}
          placeholder="write something"
        />
      </div>
      {inputValue}
    </>
  );
}

export default App;
